import oak from './assets/professorOak.png';
import './App.css';
import Navbar from './Navbar/Navbar.js';
import React,{useState,useEffect} from 'react';

function App() {

  const [Testo,setTesto] = useState();
  const [Contatore,setContatore] = useState(0);

  function ChangeText(value){
    let arrayText = [`Ciao Gamer Facciamo un Gioco`,`Pippo1`,`Pippo2`];
    setTesto(arrayText[value]);
  }

  useEffect(()=>{
    ChangeText(Contatore)
  },[Contatore])

  return (
    <div>
      <div className="App">
        <header className="App-header">
          <img src={oak} className="oak" alt="logo" />
          <div className='comparsa' onClick={()=>{setContatore(Contatore+1); console.log(Contatore)}}>
              {Testo}
          </div>
        </header>
      </div>
    </div>
  );
}

export default App;
